documentation.example:
 The example below shows the typical use of LogManager to obtain a reference to a logger and log an exception: 
ILog log = LogManager.GetLogger(this.GetType());
...
try 
{ 
  /* .... */ 
}
catch(Exception ex)
{
  log.ErrorFormat("Hi {0}", ex, "dude");
}

 The example below shows programmatic configuration of the underlying log system: 
// create properties
NameValueCollection properties = new NameValueCollection();
properties["showDateTime"] = "true";

// set Adapter
Common.Logging.LogManager.Adapter = new 
Common.Logging.Simple.ConsoleOutLoggerFactoryAdapter(properties);

documentation.remarks:
 This logger factory is mainly for debugging and test purposes.  This is an example how you might use this adapter for testing: // configure for capturing
CapturingLoggerFactoryAdapter adapter = new CapturingLoggerFactoryAdapter();
LogManager.Adapter = adapter;

// reset capture state
adapter.Clear();
// log something
ILog log = LogManager.GetCurrentClassLogger();
log.DebugFormat("Current Time:{0}", DateTime.Now);

// check logged data
Assert.AreEqual(1, adapter.LoggerEvents.Count);
Assert.AreEqual(LogLevel.Debug, adapter.LastEvent.Level);

remarks.example:
 To route all NLog events to Common.Logging, you must add this target to your configuration: LoggingConfiguration cfg = new LoggingConfiguration();
CommonLoggingTarget target = new CommonLoggingTarget("${level:uppercase=true}|${logger}|${message}");
cfg.LoggingRules.Add(new LoggingRule("*", LogLevel.Trace, target));

LogManager.Configuration = cfg;

Logger log = LogManager.GetLogger("mylogger");
log.Debug("some message");
